import React from "react";
import { Link } from "react-router-dom";
import Frame1980 from "../Frame1980";
import Frame19892 from "../Frame19892";
import Frame2981 from "../Frame2981";
import Frame1983 from "../Frame1983";
import Frame19544 from "../Frame19544";
import Frame19695 from "../Frame19695";
import Frame29822 from "../Frame29822";
import Frame194311 from "../Frame194311";
import Layer23 from "../Layer23";
import Frame3693 from "../Frame3693";
import Frame3697 from "../Frame3697";
import Frame3694 from "../Frame3694";
import Frame3698 from "../Frame3698";
import Frame3695 from "../Frame3695";
import Frame3699 from "../Frame3699";
import Frame3696 from "../Frame3696";
import Frame3700 from "../Frame3700";
import Component2 from "../Component2";
import Component22 from "../Component22";
import Plusoutline1 from "../Plusoutline1";
import "./X9CreateEnterpise_step22.css";

function X9CreateEnterpise_step22(props) {
  const {
    addRoles,
    xcontinue,
    step2Of2,
    text600,
    editInformation,
    text601,
    addPhotos,
    makeNewPosts,
    text602,
    spanText,
    spanText2,
    contentManager,
    addCustomRole,
    frame1980Props,
    frame19892Props,
    frame2981Props,
    frame1983Props,
    frame19544Props,
    frame19695Props,
    frame196952Props,
    frame29822Props,
    frame194311Props,
    layer23Props,
    frame3693Props,
    frame3697Props,
    frame3694Props,
    frame3698Props,
    frame3695Props,
    frame3699Props,
    frame3696Props,
    frame3700Props,
    component2Props,
    component22Props,
    component222Props,
    plusoutline1Props,
  } = props;

  return (
    <div className="x9-create-enterpisestep2 screen ">
      <Frame1980
        searchEnterprises={frame1980Props.searchEnterprises}
        searchoutline1Props={frame1980Props.searchoutline1Props}
      />
      <Frame19892
        frame2817Props={frame19892Props.frame2817Props}
        chevronrightoutline1Props={frame19892Props.chevronrightoutline1Props}
        chevronrightoutline12Props={frame19892Props.chevronrightoutline12Props}
      />
      <Frame2981 allEnterprises={frame2981Props.allEnterprises} yourEnterprises={frame2981Props.yourEnterprises} />
      <Frame1983>{frame1983Props.children}</Frame1983>
      <Frame19544
        ragrariansI520753={frame19544Props.ragrariansI520753}
        frame1951={frame19544Props.frame1951}
        emailoutlineProps={frame19544Props.emailoutlineProps}
        belloutlineProps={frame19544Props.belloutlineProps}
        frame2848Props={frame19544Props.frame2848Props}
      />
      <Frame19695
        frame1969={frame19695Props.frame1969}
        frame3239Props={frame19695Props.frame3239Props}
        frame2796Props={frame19695Props.frame2796Props}
      />
      <Frame19695
        frame1969={frame196952Props.frame1969}
        frame3239Props={frame196952Props.frame3239Props}
        frame2796Props={frame196952Props.frame2796Props}
        className="frame-29834"
      />
      <Frame29822
        frame2982={frame29822Props.frame2982}
        frame3239Props={frame29822Props.frame3239Props}
        frame27962Props={frame29822Props.frame27962Props}
        className="frame-29844"
      />
      <Frame194311
        frame1945Props={frame194311Props.frame1945Props}
        frame19442Props={frame194311Props.frame19442Props}
        frame1947Props={frame194311Props.frame1947Props}
        frame1948Props={frame194311Props.frame1948Props}
        frame2303Props={frame194311Props.frame2303Props}
        group1943Props={frame194311Props.group1943Props}
      />
      <div className="rectangle-8576"></div>
      <div className="frame-19647 border-1px-onyx">
        <div className="frame-19636">
          <div className="add-roles2 ibmplexsans-semi-bold-quarter-spanish-white-24px">{addRoles}</div>
          <Link to="/9-1-all-enterprises">
            <div className="close-outline-110">
              <Layer23 closeProps={layer23Props.closeProps} />
            </div>
          </Link>
        </div>
        <div className="frame-37012">
          <Link to="/9-1-all-enterprises">
            <div className="frame-28521">
              <div className="continue4 valign-text-middle ibmplexsans-semi-bold-shark-16px">{xcontinue}</div>
            </div>
          </Link>
          <div className="step-2-of-22 valign-text-middle">{step2Of2}</div>
        </div>
        <Frame3693
          leaders={frame3693Props.leaders}
          component2Props={frame3693Props.component2Props}
          className="frame-36932"
        />
        <Frame3697
          surname={frame3697Props.surname}
          component2Props={frame3697Props.component2Props}
          className="frame-36972"
        />
        <p className="text-600 ibmplexsans-normal-quarter-spanish-white-16px">{text600}</p>
        <Frame3694
          place={frame3694Props.place}
          component22Props={frame3694Props.component22Props}
          className="frame-36942"
        />
        <Frame3698
          marketers={frame3698Props.marketers}
          component22Props={frame3698Props.component22Props}
          className="frame-36982"
        />
        <Frame3695
          processing={frame3695Props.processing}
          component2Props={frame3695Props.component2Props}
          className="frame-36952"
        />
        <Frame3699
          mentors={frame3699Props.mentors}
          component22Props={frame3699Props.component22Props}
          className="frame-36992"
        />
        <Frame3696
          marketerSales={frame3696Props.marketerSales}
          component22Props={frame3696Props.component22Props}
          className="frame-36962"
        />
        <Frame3700
          accounting={frame3700Props.accounting}
          component2Props={frame3700Props.component2Props}
          className="frame-37002"
        />
        <div className="frame-3702">
          <Component2 checkmarksquare2outline2Props={component2Props.checkmarksquare2outline2Props} />
          <div className="edit-information2 ibmplexsans-semi-bold-quarter-spanish-white-16px">{editInformation}</div>
        </div>
        <p className="text-601 ibmplexsans-normal-quarter-spanish-white-16px">{text601}</p>
        <div className="frame-3703">
          <Component22
            vector={component22Props.vector}
            subtract={component22Props.subtract}
            vector2={component22Props.vector2}
          />
          <div className="add-photos ibmplexsans-semi-bold-quarter-spanish-white-16px">{addPhotos}</div>
        </div>
        <div className="frame-3704">
          <Component22
            vector={component222Props.vector}
            subtract={component222Props.subtract}
            vector2={component222Props.vector2}
          />
          <div className="make-new-posts ibmplexsans-semi-bold-quarter-spanish-white-16px">{makeNewPosts}</div>
        </div>
        <div className="frame-3705">
          <Component2 checkmarksquare2outline2Props={component22Props.checkmarksquare2outline2Props} />
          <div className="text-602 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text602}</div>
        </div>
        <div className="frame-6515 border-1px-onyx">
          <div className="frame-19346">
            <div className="role-title">
              <span className="span013">{spanText}</span>
              <span className="span113">{spanText2}</span>
            </div>
            <div className="content-manager ibmplexsans-normal-quarter-spanish-white-16px">{contentManager}</div>
          </div>
        </div>
        <div className="frame-29242">
          <Plusoutline1 vector={plusoutline1Props.vector} vector2={plusoutline1Props.vector2} />
          <div className="add-custom-role2 valign-text-middle">{addCustomRole}</div>
        </div>
      </div>
    </div>
  );
}

export default X9CreateEnterpise_step22;
